import React, { useEffect, useState } from "react";
import "./App.css";
import { BrowserRouter, Routes, Route, useNavigate } from "react-router-dom";
import axios from "axios";

import AuthPage from "./pages/AuthPage";
import ResetPasswordPage from "./pages/ResetPasswordPage";
import HomePage from "./pages/HomePage";
import AccountPage from "./pages/AccountPage";
import CountryPage from "./pages/CountryPage";
import PackagePage from "./pages/PackagePage";
import CategoryPage from "./pages/CategoryPage";
import BookPage from "./pages/BookPage";
import AdminPage from "./pages/AdminPage";
import AdminListingsPage from "./pages/AdminListingsPage";
import AdminEditListingPage from "./pages/AdminEditListingPage";
import AdminEditUserPage from "./pages/AdminEditUserPage";

// ProtectedRoute stays the same...
function ProtectedRoute({ children, allowedRole = null }) {
  const [isAuthorized, setIsAuthorized] = useState(null);
  const navigate = useNavigate();

  useEffect(() => {
    const token = localStorage.getItem("jwt");
    if (!token) {
      localStorage.setItem("error", "Please log in to access this page");
      navigate("/login");
      return;
    }

    axios
      .get("/api/users/me", { headers: { Authorization: `Bearer ${token}` } })
      .then(({ data }) => {
        if (allowedRole && data.role !== allowedRole) {
          localStorage.setItem("error", "Unauthorized access. Redirecting to home...");
          navigate("/home");
        } else {
          setIsAuthorized(true);
        }
      })
      .catch(() => {
        localStorage.setItem("error", "Invalid session. Please log in again.");
        navigate("/login");
      });
  }, [navigate, allowedRole]);

  if (!isAuthorized) return null;
  return children;
}

export default function App() {
  return (
    <BrowserRouter>
      <Routes>
        {/* public */}
        <Route path="/" element={<AuthPage />} />
        <Route path="/login" element={<AuthPage />} />
        <Route path="/reset-password" element={<ResetPasswordPage />} />

        {/* user routes */}
        <Route
          path="/home"
          element={
            <ProtectedRoute>
              <HomePage />
            </ProtectedRoute>
          }
        />
        <Route
          path="/account"
          element={
            <ProtectedRoute>
              <AccountPage />
            </ProtectedRoute>
          }
        />
        <Route
          path="/destinations/:code"
          element={
            <ProtectedRoute>
              <CountryPage />
            </ProtectedRoute>
          }
        />
        <Route
          path="/packages/:pid"
          element={
            <ProtectedRoute>
              <PackagePage />
            </ProtectedRoute>
          }
        />
        <Route
          path="/flights"
          element={
            <ProtectedRoute>
              <CategoryPage category="flights" />
            </ProtectedRoute>
          }
        />
        <Route
          path="/hotels"
          element={
            <ProtectedRoute>
              <CategoryPage category="hotels" />
            </ProtectedRoute>
          }
        />
        <Route
          path="/events"
          element={
            <ProtectedRoute>
              <CategoryPage category="events" />
            </ProtectedRoute>
          }
        />
        <Route
          path="/book/:category/:id"
          element={
            <ProtectedRoute>
              <BookPage />
            </ProtectedRoute>
          }
        />

        {/* admin console */}
        <Route
          path="/admin"
          element={
            <ProtectedRoute allowedRole="ROLE_ADMIN">
              <AdminPage />
            </ProtectedRoute>
          }
        />

        {/* users must come *before* generic :category */}
        <Route
          path="/admin/users"
          element={
            <ProtectedRoute allowedRole="ROLE_ADMIN">
              <AdminListingsPage />
            </ProtectedRoute>
          }
        />
        <Route
          path="/admin/users/:id/edit"
          element={
            <ProtectedRoute allowedRole="ROLE_ADMIN">
              <AdminEditUserPage />
            </ProtectedRoute>
          }
        />

        {/* generic listings */}
        <Route
          path="/admin/:category"
          element={
            <ProtectedRoute allowedRole="ROLE_ADMIN">
              <AdminListingsPage />
            </ProtectedRoute>
          }
        />
        <Route
          path="/admin/:category/new"
          element={
            <ProtectedRoute allowedRole="ROLE_ADMIN">
              <AdminEditListingPage />
            </ProtectedRoute>
          }
        />
        <Route
          path="/admin/:category/:id/edit"
          element={
            <ProtectedRoute allowedRole="ROLE_ADMIN">
              <AdminEditListingPage />
            </ProtectedRoute>
          }
        />
      </Routes>
    </BrowserRouter>
  );
}
